import styled from "styled-components";
import { Card } from "@mui/material";

export const Title = styled.h2`
  font-size: 17px;
  margin-top: auto;
  color: #434343;
  line-height: 25.56px;
  margin: 0px;
  margin-bottom: 20px;
  font-weight: 500;
`;
export const TableCard = styled(Card)`
  padding: 14px;
  table {
    thead {
      th {
        color: #7c7c7c;
        font-size: 15px;
        font-weight: 400;
        line-height: 22.5px;
        vertical-align: top;
        border-bottom: none;
        text-align: center;
        padding-top: 0px;
        &:first-child {
          padding-left: 0px;
        }
        .Mui-active {
          color: #7c7c7c;
        }

        input {
          background: #f8f8f8;
          padding: 10px 19px !important;
          border-radius: 5px;
          &::before {
            border-bottom: none !important;
          }
        }
      }
    }
    tbody {
      td {
        font-size: 13px;
        color: #606060;
        border-bottom: none;
      }
      tr {
        &:nth-child(odd) {
          background: #f3f3f3;
        }
      }
    }
  }
`;
